import React from 'react';
import { Switch, Route, BrowserRouter } from 'react-router-dom';
import { createBrowserHistory } from 'history';
import  Sign_In from '../ pages/authorization/sign_in';
import AuthRouter from '../ pages/authorization/index'
import { IUser } from '../interface';
import { InjectedProps } from '@material-ui/core';


interface IProps {
    onLoginUser(user : IUser, history) : void;
}

const Routers : React.FC<IProps> = ({onLoginUser} : IProps) => {
    return(
        <BrowserRouter>
            <Switch>
                <Route exact path = "/">
                    {<Sign_In  onLoginUser = {props.onLoginUser} {...props} /> }
                </Route>
                <AuthRouter {...props}/>
            </Switch>
        </BrowserRouter>
    )
}

export default Routers
